import { Component, OnInit, ViewChild } from '@angular/core';
import { JwtHelperService} from '@auth0/angular-jwt';
import {} from 'googlemaps';
import { Observable, of } from 'rxjs';
import { HttpClient } from '@angular/common/http';
import { catchError, map } from 'rxjs/operators';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent implements OnInit {
  isUserAuthenticated: Boolean = true;
  apiLoaded!: Observable<boolean>;

  constructor(private httpClient: HttpClient) {
    this.apiLoaded = this.httpClient.jsonp('https://maps.googleapis.com/maps/api/js?key=AIzaSyDzQWLR3No-WkF_N2WVLItbxZA4ZntH6t8', 'callback')
    .pipe(
      map(() => true),
      catchError(() => of(false)),
    );
   }
  ngOnInit(): void {
    const token = localStorage.getItem("jwt");
    if(token){
      this.isUserAuthenticated = true;
    }
    else{
      this.isUserAuthenticated = false;
    }  
  }
  display: any;
  center: google.maps.LatLngLiteral = {lat: 24, lng: 12};
  zoom = 4;

  moveMap(event: google.maps.MapMouseEvent){
    if(event.latLng!= null)
       this.center = (event.latLng.toJSON());
     }

  move(event: google.maps.MapMouseEvent){
    if(event.latLng!= null)
      this.display = event.latLng.toJSON();
  }

  logOut(){
    localStorage.removeItem("jwt");
    this.isUserAuthenticated = false;
  }
}
<h1>Hello, world!</h1>
<h2 *ngIf="isUserAuthenticated">You are logged in</h2>
<button class="btn btn-success" type="button" (click)="logOut()">Log out</button>
<br>
<!--<div #map style="width:100%;height:400px"></div>-->
<google-map *ngIf="apiLoaded | async"
            height = "400px"
            width = "750px"
            [center] = "center"
            [zoom] = "zoom"
            (mapClick) = "moveMap($event)"
            (mapMousemove) = "move($event)"></google-map>
<div>Latitude: {{display?.lat}}</div>
<div>Longitude: {{display?.lng}}</div>
<p>Welcome to your new single-page application, built with:</p>
<ul>
  <li><a href='https://get.asp.net/'>ASP.NET Core</a> and <a href='https://msdn.microsoft.com/en-us/library/67ef8sbd.aspx'>C#</a> for cross-platform server-side code</li>
  <li><a href='https://angular.io/'>Angular</a> and <a href='http://www.typescriptlang.org/'>TypeScript</a> for client-side code</li>
  <li><a href='http://getbootstrap.com/'>Bootstrap</a> for layout and styling</li>
</ul>
<p>To help you get started, we've also set up:</p>
<ul>
  <li><strong>Client-side navigation</strong>. For example, click <em>Counter</em> then <em>Back</em> to return here.</li>
  <li><strong>Angular CLI integration</strong>. In development mode, there's no need to run <code>ng serve</code>. It runs in the background automatically, so your client-side resources are dynamically built on demand and the page refreshes when you modify any file.</li>
  <li><strong>Efficient production builds</strong>. In production mode, development-time features are disabled, and your <code>dotnet publish</code> configuration automatically invokes <code>ng build</code> to produce minified, ahead-of-time compiled JavaScript files.</li>
</ul>
<p>The <code>ClientApp</code> subdirectory is a standard Angular CLI application. If you open a command prompt in that directory, you can run any <code>ng</code> command (e.g., <code>ng test</code>), or use <code>npm</code> to install extra packages into it.</p>
<script>
  var map;
  function initMap() {
    map = new google.maps.Map(document.getElementById('map'), {
      center: { lat: 50.450001, lng: 30.523333 },
      zoom: 8
    });
  }
</script>
<script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyDzQWLR3No-WkF_N2WVLItbxZA4ZntH6t8&callback=initMap"
        async defer></script>
